import React from 'react'

import { Link } from 'react-router-dom'

function Header()
{
    return(<>
    
                {/*React Links Calling*/}
              
                <nav className="navbar navbar-expand-lg py-3"
                 
                 style={
                     {
                         backgroundColor:'#475562',
                         borderBottom: '10px white',
                        }
                   }>
                  <div className="container-fluid">
          
                     
                    <div className="collapse  navbar-collapse justify-content-end" id="navbarNav">
                        

                        <div className= "navbar-nav">
                    <ul>
                            
                            <Link className="nav-link   text-white mx-4 "  style={{fontSize:'18px'}}  activeClassName="bg-dark"   to="/home">HOME</Link>
                        
                            <Link className="nav-link   text-white mx-5 " style={{fontSize:'18px'}} to="/about">ABOUT</Link>

                            <Link className="nav-link   text-white mx-5" style={{fontSize:'18px'}} to="/services">SERVICES</Link>
                
                            <Link className="nav-link   text-white mx-5" style={{fontSize:'18px'}} to="/contact">CONTACT</Link>
                     </ul>
                        </div>
                
          </div>
        </div>
      </nav>

                {/*React Links Calling*/} 

    </>)
}
export default Header;
